/*!
# Day 5: Alchemical Reduction

You've managed to sneak in to the prototype suit manufacturing lab. The Elves
are making decent progress, but are still struggling with the suit's size
reduction capabilities.

While the very latest in 1518 alchemical technology might have solved their
problem eventually, you can do better. You scan the chemical composition of the
suit's material and discover that it is formed by extremely long polymers (one
of which is available as your puzzle input).

The polymer is formed by smaller units which, when triggered, react with each
other such that two adjacent units of the same type and opposite polarity are
destroyed. Units' types are represented by letters; units' polarity is
represented by capitalization. For instance, r and R are units with the same
type but opposite polarity, whereas r and s are entirely different types and do
not react.

For example:

- In aA, a and A react, leaving nothing behind.
- In abBA, bB destroys itself, leaving aA. As above, this then destroys itself,
  leaving nothing.
- In abAB, no two adjacent units are of the same type, and so nothing happens.
- In aabAAB, even though aa and AA are of the same type, their polarities match,
  and so nothing happens.

Now, consider a larger example, `dabAcCaCBAcCcaDA`:

    dabAcCaCBAcCcaDA  The first 'cC' is removed.
    dabAaCBAcCcaDA    This creates 'Aa', which is removed.
    dabCBAcCcaDA      Either 'cC' or 'Cc' are removed (the result is the same).
    dabCBAcaDA        No further actions can be taken.

After all possible reactions, the resulting polymer contains 10 units.

How many units remain after fully reacting the polymer you scanned?

## Part Two

Time to improve the polymer.

One of the unit types is causing problems; it's preventing the polymer from
collapsing as much as it should. Your goal is to figure out which unit type is
causing the most problems, remove all instances of it (regardless of polarity),
fully react the remaining polymer, and measure its length.

For example, again using the polymer dabAcCaCBAcCcaDA from above:

- Removing all A/a units produces dbcCCBcCcD.
  Fully reacting this polymer produces dbCBcD, which has length 6.
- Removing all B/b units produces daAcCaCAcCcaDA.
  Fully reacting this polymer produces daCAcaDA, which has length 8.
- Removing all C/c units produces dabAaBAaDA.
  Fully reacting this polymer produces daDA, which has length 4.
- Removing all D/d units produces abAcCaCBAcCcaA.
  Fully reacting this polymer produces abCBAc, which has length 6.

In this example, removing all C/c units was best, producing the answer 4.

What is the length of the shortest polymer you can produce by removing all units
of exactly one type and fully reacting the result?
*/

use aoc18;

fn main() {
    let mut input = aoc18::ProgramInput::new(PUZZLE, INPUT);
    println!("Day 2: {}", PUZZLE);

    let input = input.to_str();
    let polymer = reduce(input);
    println!(":: Answer 1 is {}", polymer.len());

    let better_polymer = crispr(&polymer);
    println!(":: Answer 2 is {}", better_polymer.len());
}

fn reacts(left: char, right: char) -> bool {
    if left.is_ascii_lowercase() ^ right.is_ascii_lowercase() {
        left.to_ascii_lowercase() == right.to_ascii_lowercase()
    } else {
        false
    }
}

#[test]
fn test_reacts() {
    let tests = vec![('a', 'A', true), ('a', 'a', false), ('a', 'B', false)];
    for t in tests {
        assert_eq!(reacts(t.0, t.1), t.2);
    }
}

fn reduce(polymer: &str) -> String {
    let mut buf = String::with_capacity(polymer.len());
    for c in polymer.chars() {
        if let Some(last) = buf.pop() {
            if reacts(c, last) {
                continue;
            } else {
                buf.push(last);
            }
        }
        buf.push(c);
    }
    buf
}

fn remove_and_reduce(polymer: &str, remove: char) -> String {
    let remove = remove.to_ascii_lowercase();
    let mut buf = String::with_capacity(polymer.len());
    for c in polymer.chars() {
        if c.to_ascii_lowercase() == remove {
            continue;
        }
        buf.push(c)
    }
    reduce(&buf)
}

fn crispr(polymer: &str) -> String {
    let mut min = polymer.len();
    let mut result = polymer.to_owned();
    for b in ('a' as u8)..=('z' as u8) {
        let new = remove_and_reduce(polymer, b as char);
        if new.len() < min {
            min = new.len();
            result = new;
        }
    }
    result
}

#[test]
fn test_reduction() {
    let input = "dabAcCaCBAcCcaDA";
    assert_eq!(reduce(input), "dabCBAcaDA");
}

const PUZZLE: &'static str = "Alchemical Reduction";
const INPUT: &'static str = r"

";
